import React, { Component } from 'react';
import CartItem  from './CartItem'
import { ProductConsumer } from "../../context"

export default function CartList() {


        return (
            <div className="contanier-fluid">
                <ProductConsumer>
                    { value => {
                        const {cart} = value
                    {cart.map(item =>
                        {
                            return <CartItem key={item.id}
                            item={item}
                            value={value}
                            />
                        })}

                     } }
                        </ProductConsumer>

            </div>
        );
    }
